import React, { Fragment } from "react";

import { Card, Avatar, Button } from "antd";

const { Meta } = Card;

export default function Edit(props) {
  // id: a.id,
  //                     title: a.table_number,
  //                     url: a.url,
  //                     name: a.name,
  //                     order: a.order
  return (
    <Fragment>
      <Card
        key={props.location.state.id}
        title={props.location.state.title}
        cover={<img alt="" src={props.location.state.url} />}
        style={{ width: "400px" }}
      >
        <Meta
          avatar={<Avatar>{props.location.state.name}</Avatar>}
          title={props.location.state.name}
          description={props.location.state.order}
        />
      </Card>
      <Button onClick={() => props.history.push("/order")}>
        Back to Order
      </Button>
    </Fragment>
  );
}
